description:
The &quot;Round-table of Refined Rationalists&quot; is the officially unofficial podcast of the University of Calgary Freethinkers Student Club. It's structured in the same way as our meetings (ie. it isn't), and is pretty much what you'd hear if you attended.

For more about us, drop by our Google Group!
      &lt;a href=&quot;
http://groups.google.com/group/freethinkers-club/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://groups.google.com/group/freethinkers-club/&lt;/a&gt;

The show is hosted on Podbean and advertised via iTunes.

This torrent is our show archive, containing past and current shows in both low-quality MP3 and high-quality Ogg Vorbis. It's updated often, so be sure to search for the latest torrent file!
